import axios from 'axios'

export const  getTours = (page) => {
    const api = 'http://localhost:8000/api/tour/get-all-tour'
    axios.get(api, {
        params: { page: page },
    })
    .then((res) => {
        return res.data.data;
    })
    .catch((err) => {
        console.log(err);
    });
}
